import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './components/Login';  // Import Login component from components folder
import Register from './components/Register';  // Import Register component from components folder
import UserManagement from './components/UserManagement';  // Import UserManagement component from components folder
import './App.css';  // Your custom styles for App

function App() {
  return (
    <Router>
      <div className="App">
        {/* Setup Routes */}
        <Switch>
          <Route exact path="/" component={Login} />
          <Route path="/login" component={Login} />
          <Route path="/register" component={Register} />
          <Route path="/user-management" component={UserManagement} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
